Today marks a joyous day… It’s officially International Women’s Day! 👯‍♀️
That’s right, a whole day to celebrate: us. 🙋‍♀️
And so, to celebrate, we’re doing something special ✨Today officially begins one hell of a beautiful campaign with Lounge...
This is #MyBoobsMyBody 💪💜
A campaign to honour all that is ours, and all that should be celebrated. No matter our size (or cup size!), shape, race and to be honest, even gender. Our bodies carry us every day, and our boobs help define what makes us unique. 
Meet 7 incredible girls, and stick around tomorrow for an exciting announcement 👀🧐
